34	1	2	<h2>Opis</h2>\n\n<p>Jak to wygląda?</p>\n<p>Zobacz fragment:</p>\n<p></p>\n<hr />\n<h5>Kim jestem?</h5>\n<p>Nazywam się Krystian Karczyński (<a href="https://blog.etrapez.pl/o-nas/">więcej o mnie…</a>) i jestem magistrem matematyki.</p>\n<p>Nauczam studentów całek nieoznaczonych już od <strong>kilkunastu lat</strong>.</p>\n<p>Najpierw na korepetycjach. Wtedy zdarzało się, że to samo (np. całkowanie przez podstawienie) tłumaczyłem kilka godzin codziennie (bo akurat wszyscy przerabiali ten temat na Uczelni).</p>\n<p>Później stworzyłem ten Kurs, w którym zawarłem całą zdobytą w ten sposób wiedzę. Jak do tej pory kupiło go ponad <strong>4000 studentów</strong> z całej Polski.</p>\n<p></p>\n<p>Życzę przyjemnej i udanej nauki z moim Kursem</p>\n<p></p>\n<hr style="clear:both;" />\n<h5>Spis treści</h5>\n<p>Na Kurs Całek Nieoznaczonych składają się Lekcje:</p>\n<ul>\n<li>Lekcja 1 – Wprowadzenie do całek. Całki bezpośrednie i elementarne.</li>\n<li>Lekcja 2 – Całkowanie przez podstawienie</li>\n<li>Lekcja 3 – Całkowanie przez części</li>\n<li>Lekcja 4 – Całki przez podstawienie i przez części (trudniejsze całki)</li>\n<li>Lekcja 5 – Całki wymierne</li>\n<li>Lekcja 6 – Całki z pierwiastkami</li>\n<li>Lekcja 7 – Całki trygonometryczne</li>\n</ul>\n<p>Każda Lekcja składa się z materiału video i zadania domowego. Do Kursu dołączone są również materiały “bonusowe”:</p>\n<ul>\n<li>“Całki Nieoznaczone w WolframAlpha” (video 8 min)</li>\n<li>“Co to jest całka nieoznaczona?” (video 9 min)</li>\n<li>“Rozkład na ułamki proste w całce nieoznaczonej” (video 12 min)</li>\n<li>“Całka z tangensem” (video 11 min)</li>\n<li>15 artykułów na temat całek nieoznaczonych (pdf)</li>\n</ul>\n<hr />\n<h5>Jak to działa od strony technicznej?</h5>\n<ol>\n<li>Po zakupie otrzymujesz maila z linkiem do ściągnięcia Kursu.</li>\n<li>Ściągasz, rozpakowujesz i masz Kurs.</li>\n</ol>\n<p>Materiały Kursu to zwykłe pliki video (z rozszerzeniem .avi) i pdf.</p>\n<p>Poradzi sobie z nimi każdy system operacyjny, włączając w to Linux, czy systemy na komputerach Mac. Możesz je przekopiować na tablet, czy komórkę. </p>\n<p>Nie potrzebujesz też Internetu, aby się uczyć (potrzebny jest tylko na początku, do ściągnięcia Kursu).</p>\n<hr />\n<h5 style="text-align:left;">Cena</h5>\n<p style="text-align:left;">Cena wykupienia Kursu to: <strong><span style="font-size:xx-large;">39 zł</span></strong>.</p>\n<p>Teraz już tylko poświęć chwilkę i policz, czy to się opłaca. Jak myślisz, ile godzin korepetycji musiałbyś wykupić, aby nauczyć się całek nieoznaczonych?</p>\n<p>Przyjrzyjmy się bliżej. Musiałbyś przerobić:</p>\n<ul>\n<li>obliczanie całek elementarnych i sprowadzalnych do elementarnych</li>\n<li>metodę przez podstawienie</li>\n<li>metodę przez części</li>\n<li>całek wymiernych</li>\n<li>wyznaczanie dziedziny funkcji</li>\n<li>różnych metod związanych z całkami z pierwiastkami i trygonometrycznymi</li>\n</ul>\n<p>Czy uważasz, że korepetytor zdąży wytłumaczyć Ci to wszystko w ciągu, powiedzmy, 4 godzin? Tak, żebyś naprawdę dobrze zrozumiał?</p>\n<p>Ja sądzę, że wyłożenie tego wszystkiego w sposób porządny to minimum 10 godzin.</p>\n<p>A ile za godzinę liczy sobie korepetytor w Twoim mieście? Masz już w takim razie policzone przybliżone koszty, prawda?</p>\n<p>Być może powinieneś też uwzględnić: koszty dojazdu do korepetytora (głównie stracony czas), koszty poświęcania czasu, który akurat za bardzo Tobie nie pasuje (godziny popołudniowe – gdy Ty wolisz się uczyć późno w nocy, albo w okienkach w szkole)…</p>\n<p>A czy w ogóle aby na pewno MASZ zaufanego, doświadczonego i pewnego korepetytora w okolicy?</p>\n<p>A teraz po prostu PORÓWNAJ je z ceną wykupienia Kursu: <strong><span style="font-size:xx-large;">39 zł</span></strong>.</p>\n<p>W tej cenie (a jest to cena za mniej więcej <strong>jedną</strong> godzinę korepetycji) otrzymujesz:</p>\n<ul>\n<li>6 godzin nagrań video, 70 pytań testowych i około 140 zadań do rozwiązania</li>\n<li>swobodę uczenia się kiedy chcesz i gdzie chcesz</li>\n<li>możliwość rozpoczęcia nauki od ręki, bez wychodzenia nawet z domu, z jasnym programem (7 Lekcji) i rozpiską</li>\n<li>tłumaczenie od doświadczonego korepetytora, z którego Kursów korzystają tysiące studentów w całej Polsce (Kurs Całki Nieoznaczone zakupiło 4000 studentów)</li>\n<li>starannie wyselekcjonowane zadania i przykłady</li>\n<li>ważne tłumaczenie, omawiające nawet najprostsze przejścia</li>\n<li>wyraźne i czytelne prezentacje</li>\n<li>normalny, prosty język “jak do kolegi”</li>\n</ul>\n<p>Jeżeli porównanie wyszło na korzyść eTrapeza nie wahaj się dłużej!</p>\n	<p>Kurs Całki Nieoznaczone jest multimedialnym kursem edukacyjnym, podzielonym tematycznie na <strong>7 Lekcji</strong>.</p>\n<p>Zawiera łącznie <strong>360 minut nagrań video</strong>, na których powoli i od podstaw tłumaczę i pokazuję jak rozwiązywać zadania, a także <strong>70 pytań testowych</strong> sprawdzających wiedzę i około <strong>140 przykładów do zadań domowych</strong>.</p>\n	kurs-calki-nieoznaczone				Kurs Całki Nieoznaczone				
