w to Linux, czy systemy na komputerach Mac. Możesz je przekopiować na tablet, czy komórkę. </p>\n<p>Nie potrzebujesz też Internetu, aby się uczyć (potrzebny jest tylko na początku, do ściągnięcia Kursu).</p>\n<hr />\n<h5 style="text-align:left;">Cena</h5>\n<p style="text-align:left;">Cena wykupienia Kursu to: <strong><span style="font-size:xx-large;">39 zł</span></strong>.</p>\n<p>Teraz już tylko poświęć chwilkę i policz, czy to się opłaca. Jak myślisz, ile godzin korepetycji musiałbyś wykupić, aby nauczyć się szeregów? Przyjrzyjmy się bliżej. Musiałbyś przerobić:</p>\n<ul>\n<li>obliczania sumy szeregu z definicji</li>\n<li>kryterium d’Alemberta</li>\n<li>kryterium Cauchy’ego</li>\n<li>kryterium porównawczego</li>\n<li>kryterium całkowego</li>\n<li>zbieżności bezwzględnej szeregu</li>\n<li>kryterium Leibnitz’a</li>\n<li>podstaw szeregów funkcyjnych</li>\n<li>kryterium Weierstrassa</li>\n<li>twierdzeń o całkowaniu i różniczkowaniu szeregów potęgowych</li>\n<li>wyznaczania obszaru zbieżności</li>\n<li>wzorów Taylora i Maclaurina</li>\n<li>szeregów Fouriera</li>\n</ul>\n<p>Czy uważasz, że korepetytor zdąży wytłumaczyć Ci to wszystko w ciągu, powiedzmy, 4 godzin?</p>\n<p>Tak, żebyś naprawdę dobrze zrozumiał?</p>\n<p>Ja sądzę, że wyłożenie tego wszystkiego w sposób porządny to minimum kilkanaście godzin.</p>\n<p>A ile za godzinę liczy sobie korepetytor w Twoim mieście? Masz już w takim razie policzone przybliżone koszty, prawda?</p>\n<p>Być może powinieneś też uwzględnić: koszty dojazdu do korepetytora (głównie stracony czas), koszty poświęcania czasu, który akurat za bardzo Tobie nie pasuje (godziny popołudniowe – gdy Ty wolisz się uczyć późno w nocy, albo w okienkach w szkole)…</p>\n<p>A czy w ogóle aby na pewno MASZ zaufanego, doświadczonego i pewnego korepetytora w okolicy?</p>\n<p>A teraz po prostu PORÓWNAJ je z ceną wykupienia Kursu: <strong><span style="font-size:xx-large;">39 zł</span></strong>.</p>\n<p>W tej cenie (a jest to cena za mniej więcej <strong>jedną</strong> godzinę korepetycji) otrzymujesz:</p>\n<ul>\n<li>14 godzin nagrań video, 94 pytań testowych i 155 zadań do rozwiązania</li>\n<li>swobodę uczenia się kiedy chcesz i gdzie chcesz</li>\n<li>możliwość rozpoczęcia nauki od ręki, bez wychodzenia nawet z domu, z jasnym programem (10 Lekcji) i rozpiską</li>\n<li>tłumaczenie od doświadczonego korepetytora, z którego Kursów korzystają tysiące studentów w całej Polsce (Kurs Szeregów zakupiło 4000 studentów)</li>\n<li>starannie wyselekcjonowane zadania i przykłady</li>\n<li>ważne tłumaczenie, omawiające nawet najprostsze przejścia</li>\n<li>wyraźne i czytelne prezentacje</li>\n<li>normalny, prosty język “jak do kolegi”</li>\n</ul>\n<p>Jeżeli porównanie wyszło na korzyść eTrapeza nie wahaj się dłużej!</p>\n	<p>Kurs Szeregi jest multimedialnym kursem edukacyjnym, podzielonym tematycznie na <strong>10 Lekcji</strong>. Zawiera łącznie <strong>14 godzin nagrań video</strong>, na których powoli i od podstaw tłumaczę i pokazuję jak rozwiązywać zadania, a także <strong>94 pytań testowych</strong> sprawdzających wiedzę i <strong>155 przykładów do zadań domowych</strong>.</p>\n	kurs-szeregi				Kurs Szeregi				
