u, aby się uczyć (potrzebny jest tylko na początku, do ściągnięcia Kursu).</p>\n<hr />\n<h5 style="text-align:left;">Cena</h5>\n<p style="text-align:left;">Cena wykupienia Kursu to: <strong><span style="font-size:xx-large;">39 zł</span></strong>.</p>\n<p>Teraz już tylko poświęć chwilkę i policz, czy to się opłaca. Jak myślisz, ile godzin korepetycji musiałbyś wykupić, aby nauczyć się całek oznaczonych i ich zastosowań?</p>\n<p>Przyjrzyjmy się bliżej. Musiałbyś przerobić:</p>\n<ul>\n<li>całki oznaczone (z granicami całkowania)</li>\n<li>być może całki niewłaściwe (jeżeli wymagają ich na Twojej uczelni)</li>\n<li>obliczanie pól obszarów</li>\n<li>obliczanie długości łuków</li>\n<li>obliczanie objętości brył obrotowych</li>\n<li>obliczanie pól powierzchni brył obrotowych</li>\n</ul>\n<p>Czy uważasz, że korepetytor zdąży wytłumaczyć Ci to wszystko w ciągu, powiedzmy, 4 godzin? Tak, żebyś naprawdę dobrze zrozumiał?</p>\n<p>Ja sądzę, że wyłożenie tego wszystkiego w sposób porządny to minimum 10 godzin.</p>\n<p>A ile za godzinę liczy sobie korepetytor w Twoim mieście? Masz już w takim razie policzone przybliżone koszty, prawda?</p>\n<p>Być może powinieneś też uwzględnić: koszty dojazdu do korepetytora (głównie stracony czas), koszty poświęcania czasu, który akurat za bardzo Tobie nie pasuje (godziny popołudniowe – gdy Ty wolisz się uczyć późno w nocy, albo w okienkach w szkole)…</p>\n<p>A czy w ogóle aby na pewno MASZ zaufanego, doświadczonego i pewnego korepetytora w okolicy?</p>\n<p>A teraz po prostu PORÓWNAJ je z ceną wykupienia Kursu: <strong><span style="font-size:xx-large;">39 zł</span></strong>.</p>\n<p>W tej cenie (a jest to cena za mniej więcej <strong>jedną</strong> godzinę korepetycji) otrzymujesz:</p>\n<ul>\n<li>6 godzin nagrań video, 60 pytań testowych i około 100 zadań do rozwiązania</li>\n<li>swobodę uczenia się kiedy chcesz i gdzie chcesz</li>\n<li>możliwość rozpoczęcia nauki od ręki, bez wychodzenia nawet z domu, z jasnym programem (6 Lekcji) i rozpiską</l