: <strong><span style="font-size:xx-large;">39 zł</span></strong>.</p>\n<p>Teraz już tylko poświęć chwilkę i policz, czy to się opłaca. Jak myślisz, ile godzin korepetycji musiałbyś wykupić, aby nauczyć się wybranych zagadnień z tego kursu? Przyjrzyjmy się bliżej. Musiałbyś przerobić:</p>\n<ul>\n<li>czym są ciągi, elementy ciągów oraz jak zmierzyć szybkość wzrostu ciągów</li>\n<li>czym jest notacja O i jak ją wykorzystać w algorytmice</li>\n<li>co to są ciągi rekurencyjne i jak obliczać ich wyrazy</li>\n<li>jak wyznaczać wzór ogólny na ciąg rekurencyjny</li>\n<li>działań dotyczących “zbiorów Zp”, kongruencji, czyli “przystawianiu modulo p” i “działaniom modulo p”</li>\n<li>jak działa algorytm Euklidesa i jakie ma zastosowania</li>\n<li>czym są grupy, pierścienie, ciała i inne struktury algebraiczne</li>\n</ul>\n<p>Czy uważasz, że korepetytor zdąży wytłumaczyć Ci to wszystko w ciągu, powiedzmy, 2-3 godzin? Tak, żebyś naprawdę dobrze zrozumiał? Ja sądzę, że wyłożenie tego wszystkiego w sposób porządny to minimum 8-9 godzin. A ile za godzinę liczy sobie korepetytor w Twoim mieście? Masz już w takim razie policzone przybliżone koszty, prawda?</p>\n<p>Być może powinieneś też uwzględnić: koszty dojazdu do korepetytora (głównie stracony czas), koszty poświęcania czasu, który akurat za bardzo Tobie nie pasuje (godziny popołudniowe – gdy Ty wolisz się uczyć późno w nocy, albo w okienkach w szkole)… A czy w ogóle aby na pewno MASZ zaufanego, doświadczonego i pewnego korepetytora w okolicy?</p>\n<p>A teraz po prostu PORÓWNAJ je z ceną wykupienia Kursu: <strong><span style="font-size:xx-large;">39 zł</span></strong>.</p>\n<p>W tej cenie (a jest to cena za mniej więcej <strong>jedną</strong> godzinę korepetycji) otrzymujesz:</p>\n<ul>\n<li>ponad 8,5 godzin nagrań video, 70 pytań testowych i 213 zadań do rozwiązania</li>\n<li>swobodę uczenia się kiedy chcesz i gdzie chcesz</li>\n<li>możliwość rozpoczęcia nauki od ręki, bez wychodzenia nawet z domu, z jasnym programem (7 Lekcji) i rozpiską</li>\n<li>tłumaczenie od doświadczonego korepetytora, z którego Kursów korzystają tysiące studentów w całej Polsce</li>\n<li>starannie wyselekcjonowane zadania i przykłady</li>\n<li>ważne tłumaczenie, omawiające nawet najprostsze przejścia</li>\n<li>wyraźne i czytelne prezentacje</li>\n<li>normalny, prosty język “jak do kolegi”</li>\n</ul>\n<p>Jeżeli porównanie wyszło na korzyść eTrapeza nie wahaj się dłużej!</p>\n	<p>Kurs Rekurencje, Notacja O, Grupy i Pierścienie (wybrane zagadnienia) jest multimedialnym kursem edukacyjnym, wydzielonym z dawnego Kursu Matematyki Dyskretnej. Podzielony jest tematycznie na <strong>7 Lekcji</strong>.</p>\n<p>Zawiera łącznie około <strong>520 minut nagrań video</strong>, na których powoli i od podstaw tłumaczę i pokazuję jak rozwiązywać zadania, a także <strong>70 pytań testowych</strong> sprawdzających wiedzę i <strong>213 przykładów do zadań domowych</strong>.</p>\n	kurs-rekurencje-notacja-o-grupy-i-pierscienie-wybrane-zagadnienia				Kurs Rekurencje, Notacja O, Grupy i Pierścienie (wybrane zagadnienia)				
