, dzięki tym kursom ostatnie kolokwium zaliczyłem na 5. Dobrze, że jest ktoś, kto tak fajnie tłumaczy zagadnienia, z którymi można się spotkać <cite> Oceniony 5 na 5 <strong>Mateusz Gajtkowski</strong></cite></p></blockquote>\n<p> </p>\n<blockquote class="wp-block-quote" style="text-align:left;"><p>Gdyby można było dałbym w ocenie 6, albo nawet 10! Dzięki zdobytej wiedzy z kursów Pana Krystiana zaliczyłem kolokwium z matmy na 5, a dzięki zrozumieniu materiału i rozwiązywaniu zadań pomagałem innym się nauczyć. Nie mam nic innego do powiedzenia poza wielkim Dziękuję! 120% satysfakcji z zakupu, jedna z lepszych inwestycji jakie mogłem poczynić. Gorąco polecam i pozdrawiam! <cite> Oceniony 5 na 5 <strong>Dawid Borowiak</strong></cite></p></blockquote>\n<p> </p>\n<blockquote class="wp-block-quote"><p>Jednym słowem rewelacja! Wszystkie zagadnienia podane w przejrzysty, logiczny sposób a co najważniejsze zrozumiałym jęzkiem. Profesjonalny kurs matematyki za wartość niespełna 3 godzin prywatnych korepetycji. Stosunek ceny do jakości czyni go po prostu bezkonkurencyjnym. Szczerze polecam! <cite> Oceniony 5 na 5 <strong>Janusz Mikołajek</strong></cite></p></blockquote>\n<p> </p>\n<blockquote class="wp-block-quote"><p>Tak dobrego wyjaśnienia wszystkich zagadnień nie znajdzie nikt nigdzie. Są to najlepiej opracowane i pokazane metody oraz sposoby rozwiązywania wszystkich zadań. Pozdrawiam panie Krystianie i życzę wytrwałości w niesieniu pomocy wszystkim studentom i osobom zainteresowanym matematyką. <cite> Oceniony 5 na 5 <strong>Łucjan Leliński</strong></cite></p></blockquote>\n<p> </p>\n<div style="text-align:center;"><a class="button" href="https://etrapez.pl/produkt/wszystkie-kursy-etrapez/?add-to-cart=380621">169 zł – zamów paczkę wszystkich Kursów</a></div>\n<p> </p>\n<h2>Nauka z nami to…</h2>\n<ul id="mce_53" class="editor-rich-text__tinymce mce-content-body">\n<li>słuchanie normalnego, prostego języka – “jak do kolegi”, omawiamy nawet najprostsze przejścia</li>\n<li>tłumaczenie od doświadczonych korepetytorów, z których materiałów korzystają tysiące innych uczniów w całej Polsce</li>\n<li>oglądanie czytelnych i wyraźnych prezentacji, które w dowolnym momencie możesz: zwolnić, przyspieszyć, przewinąć do tyłu – jeśli chcesz coś powtórzyć, zatrzymać i wrócić ponownie</li>\n<li>swoboda uczenia się kiedy chcesz i gdzie chcesz: o 4 nad ranem, późno w nocy, w pociągu, autobusie, w okienku między zajęciami…</li>\n<li>start od ręki, nawet bez wychodzenia nawet z domu, z jasnym programem do zrobienia i rozpiską zajęć</li>\n<li>starannie wyselekcjonowane zadania i przykłady</li>\n</ul>\n<p> </p>\n<div style="text-align:center;"><a class="button" href="https://etrapez.pl/produkt/wszystkie-kursy-etrapez/?add-to-cart=380621">169 zł – zamów paczkę wszystkich Kursów</a></div>\n<p> </p>\n<h2>Cena</h2>\n<p>Paczka Wszystkich Kursów eTrapez kosztuje: <span style="font-size:xx-large;color:#FF0000;">169 zł</span> .</p>\n<p>Teraz już tylko poświęć chwilkę i policz, czy to się opłaca.</p>\n<p>Jak myślisz, ile godzin korepetycji musiałbyś wykupić, aby nauczyć się do matury, albo zaliczenia egzaminu na studiach? Czy uważasz, że korepetytor zdąży wytłumaczyć Ci to wszystko w ciągu, powiedzmy, 20 godzin? Tak, żebyś naprawdę dobrze zrozumiał? A ile za godzinę liczy sobie korepetytor w Twoim mieście? Masz już w takim razie policzone przybliżone koszty, prawda?</p>\n<p>Być może powinieneś też uwzględnić: koszty dojazdu do korepetytora (stracony czas na dojazd), koszty poświęcania czasu, który akurat za bardzo Tobie nie pasuje (godziny popołudniowe – gdy Ty wolisz się uczyć późno w nocy, albo w okienkach w szkole)… A czy w ogóle aby na pewno MASZ zaufanego, doświadczonego i pewnego korepetytora w okolicy?</p>\n<p>A teraz po prostu PORÓWNAJ je z ceną wykupienia Kursów: <span style="font-size:xx-large;color:#FF0000;">169 zł</span> .  </p>\n<h2>Jeżeli porównanie wyszło na korzyść eTrapeza nie wahaj się dłużej:</h2>\n<p> </p>\n<div style="text-align:center;"><a class="button" href="/zamowienie/?add-to-cart=380621">169 zł – zamów paczkę wszystkich Kursów</a></div>\n\t\t\t	<p>Paczka wszystkich 25 kompletnych Kursów eTrapez, łącznie z najnowszym Kursem Rekurencje, Notacja O, Grupy i Pierścienie (wybrane zagadnienia). Po zakupie otrzymasz na maila linki do ściągnięcia wszystkich Kursów.</p>\n	wszystkie-kursy-etrapez				Wszystkie Kursy eTrapez				
