62	1	2	<h2>Opis</h2>\n\n<p>Jak to wygląda?</p>\n<p>Zobacz fragment:</p>\n<p></p>\n<hr />\n<h5>Kim jestem?</h5>\n<p>Nazywam się Krystian Karczyński (<a href="https://blog.etrapez.pl/o-nas/">więcej o mnie…</a>) i jestem magistrem matematyki.</p>\n<p>Nauczam studentów granic już od <strong>kilkunastu lat</strong>. Najpierw na korepetycjach. Wtedy zdarzało się, że to samo (np. mnożenie przez sprzężenie) tłumaczyłem kilka godzin codziennie (bo akurat wszyscy przerabiali ten temat na Uczelni).</p>\n<p>Później stworzyłem ten Kurs, w którym zawarłem całą zdobytą w ten sposób wiedzę. Jak do tej pory kupiło go ponad <strong>4000 studentów</strong> z całej Polski.</p>\n<p></p>\n<p>Życzę przyjemnej i udanej nauki z moim Kursem</p>\n<p></p>\n<hr style="clear:both;" />\n<h5>Spis treści</h5>\n<p>Na Kurs Granic składają się Lekcje:</p>\n<ul>\n<li>Lekcja 1 – Wprowadzenie do granic ciągów. Wyciąganie przed nawias największej potęgi.</li>\n<li>Lekcja 2 – Mnożenie przez sprzężenie</li>\n<li>Lekcja 3 – Granice z wzorem na liczbę e</li>\n<li>Lekcja 4 – Twierdzenie o trzech ciągach. Sumy ciągu arytmetycznego i geometrycznego.</li>\n<li>Lekcja 5 – Proste granice funkcji. Powtórzenie metod z granic ciągów.</li>\n<li>Lekcja 6 – Rozkład na czynniki</li>\n<li>Lekcja 7 – Wzory na granice</li>\n<li>Lekcja 8 – Granice jednostronne funkcji. Ciągłość funkcji.</li>\n</ul>\n<p>Każda Lekcja składa się z materiału video i zadania domowego. Do Kursu dołączone są również materiały “bonusowe”:</p>\n<ul>\n<li>“Granice w WolframAlpha” (video 22 min)</li>\n<li>“Co robić, gdy granica funkcji nie istnieje?” (video 7 min)</li>\n<li>“Granica funkcji liczona rozkładem na czynniki” (video 8 min)</li>\n<li>“Granica ze stałą w wyrażeniu (de l’Hospital)” (video 8 min)</li>\n<li>“Twierdzenie o trzech ciągach” (video 3 min)</li>\n<li>“Twierdzenie o trzech funkcjach” (video 7 min)</li>\n<li>“Wzory na logarytm – jak to zrobić?” (video 8 min)</li>\n<li>24 artykuły na temat granic (pdf)</li>\n</ul>\n<hr />\n<h5>Jak to działa od strony technicznej?</h5>\n<ol>\n<li>Po zakupie otrzymujesz maila z linkiem do ściągnięcia Kursu.</li>\n<li>Ściągasz, rozpakowujesz i masz Kurs.</li>\n</ol>\n<p>Materiały Kursu to zwykłe pliki video (z rozszerzeniem .avi) i pdf.</p>\n<p>Poradzi sobie z nimi każdy system operacyjny, włączając w to Linux, czy systemy na komputerach Mac. Możesz je przekopiować na tablet, czy komórkę. </p>\n<p>Nie potrzebujesz też Internetu, aby się uczyć (potrzebny jest tylko na początku, do ściągnięcia Kursu).</p>\n<hr />\n<h5 style="text-align:left;">Cena</h5>\n<p style="text-align:left;">Cena wykupienia Kursu to: <strong><span style="font-size:xx-large;">39 zł</span></strong>.</p>\n<p>Teraz już tylko poświęć chwilkę i policz, czy to się opłaca. Jak myślisz, ile godzin korepetycji musiałbyś wykupić, aby nauczyć się liczb zespolonych? Przyjrzyjmy się bliżej. Musiałbyś przerobić:</p>\n<ul>\n<li>obliczanie granic przez wyciąganie największej potęgi przed nawias</li>\n<li>mnożenie licznika i mianownika przez sprzężenie</li>\n<li>granice z wzorem z liczbą e w wyniku</li>\n<li>twierdzenie o trzech ciągach</li>\n<li>granice ciągów z wzorami na sumę ciągu arytmetycznego i geometrycznego</li>\n<li>granice funkcji liczone metodami z granic ciągów</li>\n<li>granice funkcji liczone rozkładem na czynniki</li>\n<li>granice funkcji liczone ze wzorów</li>\n<li>granice jednostronne funkcji</li>\n<li>ciągłość funkcji</li>\n</ul>\n<p>Czy uważasz, że korepetytor zdąży wytłumaczyć Ci to wszystko w ciągu, powiedzmy, 4 godzin? Tak, żebyś naprawdę dobrze zrozumiał?</p>\n<p>Ja sądzę, że wyłożenie tego wszystkiego w sposób porządny to minimum 8 godzin. A ile za godzinę liczy sobie korepetytor w Twoim mieście? Masz już w takim razie policzone przybliżone koszty, prawda?</p>\n<p>Być może powinieneś też uwzględnić: koszty dojazdu do korepetytora (głównie stracony czas), koszty poświęcania czasu, który akurat za bardzo Tobie nie pasuje (godziny popołudniowe – gdy Ty wolisz się uczyć późno w nocy, albo w okienkach w szkole)… A czy w ogóle aby na pewno MASZ zaufanego, doświadczonego i pewnego korepetytora w okolicy?</p>\n<p>A teraz po prostu PORÓWNAJ je z ceną wykupienia Kursu: <strong><span style="font-size:xx-large;">39 zł</span></strong>.</p>\n<p>W tej cenie (a jest to cena za mniej więcej <strong>jedną</strong> godzinę korepetycji) otrzymujesz:</p>\n<ul>\n<li>6 godzin nagrań video, 80 pytań testowych i około 120 zadań do rozwiązania</li>\n<li>swobodę uczenia się kiedy chcesz i gdzie chcesz</li>\n<li>możliwość rozpoczęcia nauki od ręki, bez wychodzenia nawet z domu, z jasnym programem (8 Lekcji) i rozpiską</li>\n<li>tłumaczenie od doświadczonego korepetytora, z którego Kursów korzystają tysiące studentów w całej Polsce (Kurs Granic zakupiło 4000 studentów)</li>\n<li>starannie wyselekcjonowane zadania i przykłady</li>\n<li>ważne tłumaczenie, omawiające nawet najprostsze przejścia</li>\n<li>wyraźne i czytelne prezentacje</li>\n<li>normalny, prosty język “jak do kolegi”</li>\n</ul>\n<p>Jeżeli porównanie wyszło na korzyść eTrapeza nie wahaj się dłużej!</p>\n	<p>Kurs Granic jest multimedialnym kursem edukacyjnym, podzielonym tematycznie na <strong>8 Lekcji</strong>.</p>\n<p>Zawiera łącznie <strong>350 minut nagrań video</strong>, na których powoli i od podstaw tłumaczę i pokazuję jak rozwiązywać zadania, a także <strong>80 pytań testowych</strong> sprawdzających wiedzę i około <strong>120 przykładów do zadań domowych</strong>.</p>\n	kurs-granice				Kurs Granice				
