a – w stylu “jak do kolegi”. Różni się bardzo od tego, jaki słyszą w szkole i na uczelni.  </p>\n\t\t\t	<p>Paczka wszystkich 6 kompletnych Kursów eTrapez do Szkoły Średniej, łącznie z najnowszym Kursem Matura Rozszerzona Część 3. Autorką Kursów jest <a href="https://blog.etrapez.pl/o-nas/#anna-zalewska">Anna Zalewska</a>. Po zakupie otrzymasz na maila linki do ściągnięcia wszystkich Kursów.</p>\n<p>Pracujemy obecnie nad kolejnym Kursem: <a href="https://etrapez.pl/produkt/kurs-planimetria-przedsprzedaz/">z Planimetrii</a>. Dostępny jest on w PRZEDSPRZEDAŻY, ale tylko jako osobny produkt. Kurs ten zostanie dodany do Paczki Kursów Szkoła Średnia gdy będzie w pełni ukończony.</p>\n	wszystkie-kursy-etrapez-do-szkoly-sredniej				Wszystkie Kursy eTrapez do Szkoły Średniej				
