l>\n<p><strong>Kurs w przedsprzedaży nie jest dostępny w żadnej paczce.</strong> Można go kupić TYLKO jako osobny produkt za 29zł.</p>\n<p><strong>Każda kolejna gotowa lekcja jest udostępniania na bieżąco za darmo wszystkim, którzy kupili już kurs w przedsprzedaży.</strong></p>\n<p>Poniżej lista tematów, które będzie zawierał kompletny Kurs Planimetria:</p>\n<ul>\n<li>Lekcja 1 – Pojęcia wstępne (wersja podstawowa i rozszerzona)</li>\n<li>Lekcja 2 – Trójkąty (wersja podstawowa i rozszerzona)</li>\n<li>Lekcja 3 – Czworokąty (wersja podstawowa i rozszerzona)</li>\n<li>Lekcja 4 – Wielokąty (wersja podstawowa i rozszerzona)</li>\n<li>Lekcja 5 – Okręgi i koła (wersja podstawowa i rozszerzona)</li>\n<li>Lekcja 6 – Dowody w planimetrii (wersja podstawowa i rozszerzona)</li>\n<li>Lekcja 7 – Zadania maturalne (wersja podstawowa i rozszerzona)</li>\n</ul>\n<p>Każda Lekcja składa się z materiału video i zadania domowego.</p>\n<hr />\n<h2>Jak to działa od strony technicznej?</h2>\n<ol>\n<li>Po zakupie otrzymujesz maila z linkiem do ściągnięcia Kursu.</li>\n<li>Ściągasz plik, rozpakowujesz i masz Kurs.</li>\n<li>Gdy dodamy kolejną lekcję do tego Kursu, dostaniesz automatycznie od nas wiadomość z linkiem do jej pobrania.</li>\n</ol>\n<p>Materiały Kursu to zwykłe pliki video (z rozszerzeniem .mp4) i pdf. Poradzi sobie z nimi każdy system operacyjny, włączając w to Linux, czy systemy na komputerach Mac. Możesz je przekopiować na tablet, czy komórkę. Nie potrzebujesz też Internetu, aby się uczyć (potrzebny jest tylko na początku, do ściągnięcia Kursu).</p>\n<hr />\n<h2 style="text-align:left;">Cena</h2>\n<p style="text-align:left;">Cena wykupienia Kursu w przedsprzedaży to:<span style="color:#000000;"> <span style="font-size:x-large;">29 zł.</span></span></p>\n<p>Teraz już tylko poświęć chwilkę i policz, czy to się opłaca.</p>\n<p>Jak myślisz, ile godzin korepetycji musiałbyś wykupić, aby dobrze nauczyć się wszystkiego co jest związane np. z trójkątami czy czworokątami w szkole średn