) i pdf.</p>\n<p>Poradzi sobie z nimi każdy system operacyjny, włączając w to Linux, czy systemy na komputerach Mac. Możesz je przekopiować na tablet, czy komórkę. </p>\n<p>Nie potrzebujesz też Internetu, aby się uczyć (potrzebny jest tylko na początku, do ściągnięcia Kursu).</p>\n<hr />\n<h5 style="text-align:left;">Cena</h5>\n<p style="text-align:left;">Cena wykupienia Kursu to: <strong><span style="font-size:xx-large;">39 zł</span></strong>.</p>\n<p>Teraz już tylko poświęć chwilkę i policz, czy to się opłaca. Jak myślisz, ile godzin korepetycji musiałbyś wykupić, aby nauczyć się równań różniczkowych?</p>\n<p>Przyjrzyjmy się bliżej. Musiałbyś przerobić:</p>\n<ul>\n<li>metodę zmiennych rozdzielonych</li>\n<li>podstawienia sprowadzające równanie do równania o zmiennych rozdzielonych</li>\n<li>równania liniowe I-go rzędu jednorodne i niejednorodne</li>\n<li>kilka typów równań nieliniowych I-go rzędu</li>\n<li>równania liniowe II-go rzędu</li>\n<li>układy równań liniowych</li>\n<li>transformaty Laplace’a</li>\n</ul>\n<p>Czy uważasz, że korepetytor zdąży wytłumaczyć Ci to wszystko w ciągu, powiedzmy, 4 godzin? Tak, żebyś naprawdę dobrze zrozumiał?</p>\n<p>Ja sądzę, że wyłożenie tego wszystkiego w sposób porządny to minimum kilkanaście godzin.</p>\n<p>A ile za godzinę liczy sobie korepetytor w Twoim mieście? Masz już w takim razie policzone przybliżone koszty, prawda?</p>\n<p>Być może powinieneś też uwzględnić: koszty dojazdu do korepetytora (głównie stracony czas), koszty poświęcania czasu, który akurat za bardzo Tobie nie pasuje (godziny popołudniowe – gdy Ty wolisz się uczyć późno w nocy, albo w okienkach w szkole)…</p>\n<p>A czy w ogóle aby na pewno MASZ zaufanego, doświadczonego i pewnego korepetytora w okolicy? A teraz po prostu PORÓWNAJ je z ceną wykupienia Kursu: <strong><span style="font-size:xx-large;">39 zł</span></strong>.</p>\n<p>W tej cenie (a jest to cena za mniej więcej <strong>jedną</strong> godzinę korepetycji) otrzymujesz:</p>\n<ul>\n<li>9 godzin nagrań video, 67 pytań testowych i kilkaset zadań do rozwiązania</li>\n<li>swobodę uczenia się kiedy chcesz i gdzie chcesz</li>\n<li>możliwość rozpoczęcia nauki od ręki, bez wychodzenia nawet z domu, z jasnym programem (7 Lekcji) i rozpiską</li>\n<li>tłumaczenie od doświadczonego korepetytora, z którego Kursów korzystają tysiące studentów w całej Polsce (Kurs Równań Różniczkowych zakupiło 4000 studentów)</li>\n<li>starannie wyselekcjonowane zadania i przykłady</li>\n<li>ważne tłumaczenie, omawiające nawet najprostsze przejścia</li>\n<li>wyraźne i czytelne prezentacje</li>\n<li>normalny, prosty język “jak do kolegi”</li>\n</ul>\n<p>Jeżeli porównanie wyszło na korzyść eTrapeza nie wahaj się dłużej!</p>\n	<p>Kurs Równań Różniczkowych jest multimedialnym kursem edukacyjnym, podzielonym tematycznie na <strong>7 Lekcji</strong>. Zawiera łącznie <strong>9 godzin nagrań video</strong>, na których powoli i od podstaw tłumaczę i pokazuję jak rozwiązywać zadania, a także <strong>67 pytań testowych</strong> sprawdzających wiedzę i <strong>kilkaset przykładów do zadań domowych</strong>.</p>\n	kurs-rownania-rozniczkowe				Kurs Równania Różniczkowe				
